import data from '/home/johnatan/Downloads/dataJson.json'
import React from 'react'
import { Card, CardTitle } from 'reactstrap'


const newdata = data.map((data) => {
    return (
        <Card key={data.item_id}>
            <Card.Body>
                <Card.Title>{data.municipio}</Card.Title>
                <Card.Text>{data.original}</Card.Text>
            </Card.Body>
        </Card>
    )
})
